import Card from "../CARD/Card";
import { useSelector } from "react-redux";

const Favourites = () =>{
    const favourites = useSelector((state) => state.myFavourites)
    return(
        <div>
        {
            favourites.map(({id,name,status,gender,species,origin,image}) => {
                return <Card
                key={id}
                id={id}
                name={name}
                status={status}
                species={species}
                gender={gender}
                origin={origin.name}
                image={image}
                />;
            })
        }
        </div>
    )
}

export default Favourites;
